const image = { uri: "https://cdn5.f-cdn.com/contestentries/1116766/10361669/59a756283371e_thumb900.jpg" };

export default function App() {
  return (
    <View style={styles.container}>

      <Image style={styles.pic} source={{uri:'https://www.pngkey.com/png/full/194-1946002_logo-logo-penguin-logo-png.png'}}/>
      <Text style={styles.textBrand}>Minguins</Text>
      <Text style={styles.textRed}>Mobile Computing</Text>

    </View>
  );
}

const styles = StyleSheet.create({

  container:{
backgroundColor:"#12a5b5",
